import React from 'React'
import styled from 'styled-components'
import 'bootstrap/dist/css/bootstrap.min.css'
const UL = styled.ul`
list-style: none;
display: flex;
flex-flow: row nowrap;
li
`;
const RigutNav = () => {
    return(
        <UL>
            <li>MIGAS_PIGMENTOS</li>
            <li>POLVOS_PIGMENTOS</li>
            <li>TRANSLICIDOS</li>
        </UL>
    )

}
export default RigutNav
